import React from "react";
import Header from "../../Components/Header";
import Card from "../../Components/UI/Cards";
import "./style.css";

const Home = (props) => {
  const galleryheight = 450;
  const gallerystyle = {
    height: galleryheight + "px",overflow:hidden
  };
  return (
    <div>
      <Card>
        <div className="gallerypost" style={{}}>
          <section>
            <div>
              <img
                src={require("../../blogimg/awa.jpg").default}
                alt="Popular Image"
              />{" "}
            </div>
          </section>
          <section>Less Popular</section>
        </div>
      </Card>
    </div>
  );
};

export default Home;
